            flex-wrap:wrap;
            flex-direction:row;
        }
    `;

    const navigate = useNavigate();

  return (
    <Hero>
        <Container>
           <div className='parent'>

           </div>
        </Container>
    </Hero>
  )
}

export default Herosmall
